import React from 'react';
import {
  Routes,
  Route,
  BrowserRouter,
} from 'react-router-dom';
import Homepage from './pages/Homepage';

function App() {
  return (
    <div className="App">
      <div classNaame="p-6 max-w-sm mx-auto bg-white rounded- shadow-lg flex items-center space-x-4">
        <div>
          <div classNaame="text-xl font-medium text-black">ChitChat</div>
          <p classNaame="text-slate-500">You have a new message!</p>
        </div>
      </div>
      <p className="text-white">Good Mourning.</p>
      <BrowserRouter>
        <Routes>

          <Route path="/" element={<Homepage/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
